// SPDX-License-Identifier: GPL-3.0

pragma solidity >= 0.7.0 < 0.9.0;

contract Oracles {
    address admin;
    uint public rand;

    constructor () {
        admin = msg.sender;
    }

    function setRand(uint value) public {
        require(msg.sender == admin, "only admin can call this");
        rand = value;
    }
}

